import React, { Component } from 'react'

export default class Line extends Component {
    constructor(props) {
        super(props);
        
    }
    render() {
        return (
            <div>
                   <tr>
          <td>props.item._id</td>
          <td>props.item.username</td>
          <td>props.item.password</td>
      </tr>

            </div>
        )
    }
}
